import React from 'react';
import { Row, Col } from 'antd';
class HomePage extends React.Component {
    render() {
        return (
            <>
                <Row>
                    <Col span={6}>col-6</Col>
                    <Col span={18}>col18</Col>
                </Row>
            </>
        );
    }
}

export default HomePage;
